bitvec’s more technically-interesting capability is that it provides load/store memory access behaviors that allow you to write values into, and read them back out of, any BitSlice in memory rather than being constrained to well-formed references to well-typed memory. This is useful for the de/construction of packed memory buffers, such as transporting data through I/O protocols. AUTHOR’S NOTE : If you are using bitvec to do anything related to the underlying memory representation of a bit-buffer, you must read this chapter, and all of the API docs of bitvec::field and its contents, in their entirety . I have written extensively, and yet still insufficiently, about the intricacies involved in operating the BitField trait correctly. If you skim this documentation, you will have unexpected behavior, you will get frustrated with me for writing a bad library, you will file an issue about it, and I will probably tell you that the behavior is correct and that I already addressed it in the documentation. It took me a long time to think about and a long time to write. It should take you also a long time to read and a long time to think about. All of this behavior is contained in the BitField trait. Let’s explore that: // bitvec::field pub trait BitField { fn load<M>(&self) -> M; fn store<M>(&mut self, value: M);
} impl<T> BitField for BitSlice<T, Lsb0> { fn load<M>(&self) -> M { /* snip */ } fn store<M>(&mut self, value: M) { /* snip */ }
} impl<T> BitField for BitSlice<T, Msb0> { fn load<M>(&self) -> M { /* snip */ } fn store<M>(&mut self, value: M) { /* snip */ }
} The actual trait is more complex than this, and will be visited later. The important part, right now, is that BitField allows you to load values out of BitSlices and store values into them. Furthermore, it is implemented specifically on BitSlices that use the bit orderings provided by bitvec, and is not generic over all orderings. While bitvec could in theory provide a default implementation for all <O: BitOrder>, this would by necessity have the most pessimal possible performance, and the lack of specialization for overlapping trait implementations means that faster performance can never be written. The downside of the two specific implementations is that Rust coherence rules forbid implementation of a bitvec trait, on a bitvec type, parameterized with a local, but non-bitvec, ordering type. On the off chance that you find yourself writing a new BitOrder implementor, file an issue. The M type parameter on the load and store methods is bounded by funty’s Integral, trait. It can store any unsigned or signed integer at any partial width. This parameterization allows you to combine any integer type for transfer with any integer type for storage, rather than being restricted to only transferring T data into and out of a BitSlice<T, _>. Unfortunately, adding a second integer type parameter is not the only complication to the BitStore memory model. There is also a second dimension of segment ordering. bitvec tries to make explicitly clear that the Lsb0 and Msb0 types refer only to the ordering of bits within registers, and not to the ordering of bytes within registers. However, when the register being stored or stored does not fit within one register of the storage BitSlice, it must be split into multiple segments, and those segments must somehow be ordered in memory.

