Slice references contain two pieces of information: the address of the base element, and the number of elements, starting at the base, contained in the slice region. Theoretically, bit-slice references have the same pair of information: the address of the first bit, and the number of bits in the region. However, computers are byte-addressed, not bit-addressed, so we need to store three more bits (to select a bit in the base byte) somewhere in the reference. Since slice references are defined as { base: *T, elts: usize }, and there are no [1] spare bits in *const _, the bits to store the base bit are taken out of the length counter. Reference address values are also required to be integer multiples of the alignment of the referent type T. This alignment is, on all supported targets, the width in bytes of the referent type. As a result, there are as many low bits in the address of any T that are guaranteed to be the 0 value, as there are bits needed to select a byte within the element. The end result is that the length counter must always use three bits to store the starting bit, and the base address will be composed of an aligned T address and an index of the starting byte within it. As Rust does not have bitfield syntax, a definition of the pointer structure in C++ looks like this: template <typename T>
struct BitSpan<T> { static_assert( std::is_unsigned<T> && sizeof(T) <= sizeof(size_t) && sizeof(T) <= alignof(T) ); uintptr_t ptr_head : __builtin_ctzll(alignof(T)); uintptr_t ptr_addr : sizeof(uintptr_t) * CHAR_BITS; - __builtin_tczll(alignof(T)); size_t len_head : 3; size_t len_bits : sizeof(size_t) * 8 - 3;
} In Rust, the structure is declared as // src/pointer.rs #[repr(C)]
pub struct BitSpan<T, O>
where T: BitStore, O: BitOrder,
{ ptr: NonNull<u8>, len: usize, _ty: PhantomData<T>, _or: PhantomData<O>,
} and the logical components must be accessed through get/set functions, rather than through compiler-generated field stubs. By marking the pointer as NonNull, BitSpan declares that it will never be a null pointer and becomes subject to the same peephole optimization that allows mem::size_of::<Option<&T>>() == mem::size_of::<&T>(). By marking it as unconditionally a pointer to u8, we declare that all low bits of the address value are in use, and none can be used as slots for anything else (since our encoding is using them to select a byte within the T).

