where T: BitStore, O: BitOrder,
{ fn eq(&self, other: &Self) -> bool { todo!("baseline") }
} impl<T> BitSlice<T, Lsb0>
where T: BitStore { fn eq(&self, other: &Self) -> bool { todo!("lsb0-accelerated version") }
