where T: BitStore, O: BitOrder,
{ fn eq(&self, other: &Self) -> bool { if let (Some(this), Some(that)) = ( self.coerce::<T, Lsb0>(), other.coerce::<T, Lsb0>(), ) { todo!("lsb0-accelerated version") } else if let (Some(this), Some(that)) = ( self.coerce::<T, Msb0>(), other.coerce::<T, Msb0>(), ) { todo!("msb0-accelerated version") } else { todo!("baseline") } }
