In addition to these method constructors, you may also use the bits! constructor macro. This macro runs at compile-time to produce a buffer containing the correct data values, then borrows it as a BitSlice reference. It is a macro_rules! macro, not a procedural macro, and should not have a significant impact on your compilation times. By default, the produced buffer is a temporary that the compiler will then extend to have the minimum lifetime of the produced reference handle. However, you can use the static keyword to cause the macro to produce a hidden and unnameable static BitArray backing buffer, which then provides the &'static BitSlice lifetime. Since this static buffer cannot be named, it is safe to use even when mutable, as the provided reference is the only handle to it. The macro syntax extends that of vec!. The simplest invocations are sequences or repetitions of expressions, which can optionally be made mutable: use bitvec::prelude::*; let r = bits![0, 1, 0, 1];
let w = bits![mut 0, 1, 0, 1]; let r2 = bits![static 1; 4];
let w2 = bits![static mut 1; 4]; You are not required to use the literals 0 or 1; you can use any expression that is const-evaluable and can be placed into the expression expr != 0. This means that you cannot use the names of runtime let bindings, but can use the names of const bindings, or other literals. You probably do not want to do this, but you can . In addition, you can specify the bit-ordering parameter and the integer storage parameter, for even more precise control over the memory layout. If you do not specify them, the macro uses the default parameters of usize storage and Lsb0 ordering. use bitvec::prelude::*; let in_bytes = bits![u8, LocalBits; 0, 1, 0, 1];
let in_shorts = bits![u16, Lsb0; 0, 1, 0, 1];
let in_ints = bits![mut u32, Msb0; 0; 4]; To summarize the macro rules: If the first macro argument is mut, then the macro produces &mut BitSlice, otherwise it produces &BitSlice. You do not need to bind the name as mut unless you want to reässign it to a different slice. You may then optionally provide the storage and ordering type parameters, followed by a semicolon. If you choose to add type parameters: You must provide the bit-ordering parameter. You may provide the storage parameter. The data input to the macro is one of the two vec! token lists: One or more expressions that can be placed into $expr != 0, separated by commas. A trailing comma is permitted. A single expression that can be placed into $expr != 0, followed by a semicolon and a repetition counter. The resulting BitSlice will be counter bits long, all set to expression. Emulation tests indicate that bitvec correctly instructs the compiler to produce suitable buffers even when compiling for a target with a different byte-endianness than the host. However, I have not actually performed such cross-compilation and testing with real hardware. It should be correct; please file an issue if it is not.
